text:
Nel #DDLZan esce tutto il furore ideologico del #gender. Nell'indistinto di questa legge tutto è consentito tranne che pensare diversamente da quello che vuole questa specie di pensiero unico. @FratellidItalia si batterà ovunque contro questo provvedimento!
@FDI_Parlamento
-Staff https://t.co/s0TRhqgq69

Nel #DDLZan l'identità di #genere è soggettiva. Si perde così l'oggettività. L'identità del singolo viene scomposta e non si distingue più tra opinioni e discriminazioni!
Non c'entra l'omofobia!Questa è la più grande offensiva ideologica dei sacerdoti del #gender
@FratellidItalia https://t.co/Xd0Xekf8Rn

Non c'è solo @FratellidItalia contro il #DDLZan. Fuori dal #Parlamento sono plurime le voci che si stagliano contro le distorsioni di questa legge: giuristi, associazioni, intellettuali
@FDI_Parlamento @vocedelpatriota 
-Staff https://t.co/dxUWvHKFvI

🔴#Oggi in #Senato sul #ddlZan la sinistra vince per un solo voto. È chiaro che mancano i numeri per approvarlo.
@FratellidItalia chiede che questo disegno di legge liberticida e pericoloso venga ritirato.
#NoDdlZan 
@FDI_Parlamento @GiorgiaMeloni @vocedelpatriota 
👇Il #Tg1 https://t.co/vy1KJiHWAF

